import axios from "axios"

const initailState = {
    user: []
}

const reducer = (state = initailState,action)=>{

    switch (action.type) {
        case "FETCH_USER_SUCCESS":
            return{
                ...state,
                user: action.payload
            }
        default:
            return{
                ...state,
                user: "testDefault"
            }
    }
}
export default reducer
